// src/components/ContactUs.js
import React from 'react';

function Contact() {
  return (
    <div className="container my-5">
      <h1>Contact Us</h1>
      <p>
        Have questions or want to get in touch? Reach out to us through the following methods:
      </p>
      <ul>
        <li>Email: project.eventsphere2024@gmail.com</li>
        <li>Phone: +91 7666606105</li>
        <li>Address: Lane No-06, Canal Rd, opp. to Swami Samarth mandir, Dnydeep Colony, Wanawari, Hingne Budrukh, Karve Nagar, Pune, Maharashtra</li>
      </ul>
      {/* Add more contact details as needed */}
    </div>
  );
}

export default Contact;
